import './resume.css';
import React from 'react';
import { Card, ListGroup } from 'react-bootstrap';
import { connect } from 'react-redux';

const Resume = (props) => {

    const createJobGroup = (jobs) =>{
      const test = (jobs[0].whathappened[0]);

      return (
        <>
          {jobs.map(function(job) {
            return (
              <>
                {job.company}<br></br>
                <small>{job.type} - {job.roll} </small>
                <ul>
                  {getWhatIDid(job.whathappened)}
                </ul>
              </>
            );
          })}
        </>
      ); 

    }

    const getWhatIDid = (whathappened) =>{
      console.log(whathappened);
      return(
        <li>test</li>
      )
    }

    return (
      <div className="container">
        <Card className="justify-content-center">
        <Card.Body>
          <Card.Title className="text-center"> Michael Di Paolo </Card.Title>
          <Card.Subtitle className="mb-2 text-muted text-center">Chicago, Illinois - notdipaolo@outlook.com</Card.Subtitle>  

              <ListGroup variant="flush">
                <ListGroup.Item> 
                  <h5>Education</h5>
                    DePaul University <br></br> 
                    <small>Bachelor of Science in Computer Science - Software Development </small>
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Work Experience</h5>
                  {createJobGroup(props.resume.jobs)}
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Additional Industry Experience</h5>
                  {createJobGroup(props.resume.additionalIndustryExperience)}
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Relevant Coursework</h5>
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Projects</h5>
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Extracurriculars</h5>
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Clubs</h5>
                </ListGroup.Item>
              </ListGroup>
          </Card.Body>
        </Card>
      </div>

    )
}

function mapStateToProps(state){
  const resume = state.resumeReducer;
  return {
    resume: resume
  }
}

export default connect(mapStateToProps)(Resume);
